%pyspark
# weather classify : 0=spring, 1=summer, 3=fall, 4=winter, -1=error
def weather(month):
    if 3 <= month <= 5:
        return 0
    elif 6 <= month <= 8:
        return 1
    elif 9 <= month <= 11:
        return 2
    elif month <= 12 or 1 <= month <= 2:
        return 3
    else:
        return -1

udf_weather = udf(weather, IntegerType())

df = df.withColumn('weather', udf_weather('month'))
df.show()
df.createOrReplaceTempView('illum_uv')

%sql
select * from illum_uv
where euvb > 0
and clean = 1
-- and date = ${date="2019-03-08"}
-- and weather = ${weather=2}
-- and month = ${month=1}
-- and division = ${division='하지'}
and illum between 99000 and 101000
order by date, time

%sql
select date, time, illum, euvb from illum_uv
where date = ${date="2017-05-23"}
